sys_variable_value.value:
    (function execute(inputs, outputs) {
// ... code ...
var req=inputs.req;
if(req.variantId=="VRN003"){
    outputs.years = ((req.swpYears) && (parseInt(req.swpYears) < 11)) ? parseInt(req.swpYears) : parseInt(req.pt) -4;
    outputs.flag="Y";
    req.swpYears=outputs.years;
    req.swpFlag="Y";
    outputs.req=req
}
else{
    outputs.years = "";
    outputs.flag="N";
    outputs.req=req;
}

outputs.proposal_type=(req.isNri=="N"||req.isNri=="NGST")?"N":"I";

var session = gs.getSession();
    var ipAddr = session.getClientIP();
 // gs.info(ipAddr +"ipaddress");

outputs.ip=ipAddr

})(inputs, outputs);

